ErrorCode DynamicAlgRTM::getTorqueInverseDynamics(const Joint joint, const JointVelocity vel, const JointAcceleration acc, 
                                                  JointTorque &torque)
{
    //prepare variable
    computeMatrixElementInverseDynamics(joint, vel, acc);
    
    //pai[52]
    double pai[PARAM_SET] = {ZZR1, FS1, FV1, XXR2, XY2, XZR2, YZ2, ZZR2, MXR2, MY2, FS2, FV2, XXR3, XYR3, XZ3, YZ3, ZZR3, MXR3, MYR3, Im3, FS3, FV3,
                      XXR4, XY4, XZ4, YZ4, ZZR4, MX4, MYR4, Im4, FS4, FV4, XXR5, XY5, XZ5, YZ5, ZZR5, MX5, MYR5, Im5, FS5, FV5,
                      XXR6, XY6, XZ6, YZ6, ZZ6, MX6, MY6, Im6, FS6, FV6};
    //print
    /*printf("pai:\n");
    for(int i = 0; i < PARAM_SET; ++i)
    {
        printf("%f\n", pai[i]);
    }*/

    //A[52][6]                   //Y1
    double A[PARAM_SET][LINKS] = {{DG1ZZ1,0,0,0,0,0}, {DG1FS1,0,0,0,0,0}, {DG1FV1,0,0,0,0,0},
                       //Y2
                       {DG1XX2, DG2XX2, 0, 0, 0, 0}, {DG1XY2, DG2XY2, 0, 0, 0, 0}, {DG1XZ2, DG2XZ2, 0, 0, 0, 0},{DG1YZ2, DG2YZ2, 0, 0, 0, 0}, {DG1ZZ2, DG2ZZ2, 0, 0, 0, 0}, 
                       {DG1MX2, DG2MX2, 0, 0, 0, 0}, {DG1MY2, DG2MY2, 0, 0, 0, 0}, {0, DG2FS2, 0, 0, 0, 0}, {0, DG2FV2, 0, 0, 0, 0},
                       //Y3
                       {DG1XX3, DG2XX3, DG3XX3, 0, 0, 0}, {DG1XY3, DG2XY3, DG3XY3, 0, 0, 0}, {DG1XZ3, DG2XZ3, DG3XZ3, 0, 0, 0}, {DG1YZ3, DG2YZ3, DG3YZ3, 0, 0, 0}, {DG1ZZ3, DG2ZZ3, DG3ZZ3, 0, 0, 0}, 
                       {DG1MX3, DG2MX3, DG3MX3, 0, 0, 0}, {DG1MY3, DG2MY3, DG3MY3, 0, 0, 0}, {0, 0, DG3Im3, 0, 0, 0}, {0, 0, DG3FS3, 0, 0, 0}, {0, 0, DG3FV3, 0, 0, 0},
                       //Y4
                       {DG1XX4, DG2XX4, DG3XX4, DG4XX4, 0, 0}, {DG1XY4, DG2XY4, DG3XY4, DG4XY4, 0, 0}, {DG1XZ4, DG2XZ4, DG3XZ4, DG4XZ4, 0, 0}, {DG1YZ4, DG2YZ4, DG3YZ4, DG4YZ4, 0, 0}, {DG1ZZ4, DG2ZZ4, DG3ZZ4, DG4ZZ4, 0, 0}, 
                       {DG1MX4, DG2MX4, DG3MX4, DG4MX4, 0, 0}, {DG1MY4, DG2MY4, DG3MY4, DG4MY4, 0, 0}, {0, 0, 0, DG4Im4, 0, 0}, {0, 0, 0, DG4FS4, 0, 0}, {0, 0, 0, DG4FV4, 0, 0},
                       //Y5
                       {DG1XX5, DG2XX5, DG3XX5, DG4XX5, DG5XX5, 0}, {DG1XY5, DG2XY5, DG3XY5, DG4XY5, DG5XY5, 0}, {DG1XZ5, DG2XZ5, DG3XZ5, DG4XZ5, DG5XZ5, 0}, {DG1YZ5, DG2YZ5, DG3YZ5, DG4YZ5, DG5YZ5, 0}, {DG1ZZ5, DG2ZZ5, DG3ZZ5, DG4ZZ5, DG5ZZ5, 0}, 
                       {DG1MX5, DG2MX5, DG3MX5, DG4MX5, DG5MX5, 0}, {DG1MY5, DG2MY5, DG3MY5, DG4MY5, DG5MY5, 0}, {0, 0, 0, 0, DG5Im5, 0}, {0, 0, 0, 0, DG5FS5, 0}, {0, 0, 0, 0, DG5FV5, 0},
                       //Y6
                       {DG1XX6, DG2XX6, DG3XX6, DG4XX6, DG5XX6, DG6XX6}, {DG1XY6, DG2XY6, DG3XY6, DG4XY6, DG5XY6, DG6XY6}, {DG1XZ6, DG2XZ6, DG3XZ6, DG4XZ6, DG5XZ6, DG6XZ6}, {DG1YZ6, DG2YZ6, DG3YZ6, DG4YZ6, DG5YZ6, DG6YZ6}, {DG1ZZ6, DG2ZZ6, DG3ZZ6, DG4ZZ6, DG5ZZ6, DG6ZZ6}, 
                       {DG1MX6, DG2MX6, DG3MX6, DG4MX6, DG5MX6, DG6MX6}, {DG1MY6, DG2MY6, DG3MY6, DG4MY6, DG5MY6, DG6MY6}, {0, 0, 0, 0, 0, DG6Im6}, {0, 0, 0, 0, 0, DG6FS6}, {0, 0, 0, 0, 0, DG6FV6}};

    //compute tau = A*pai
    double temp_torque[LINKS] = {0};
    for (int i = 0; i < LINKS; ++i)
    {
        for(int j = 0; j < PARAM_SET; ++j)
        {
            temp_torque[i] += A[j][i] * pai[j];//A[52][6] * pai[52]
        }
    }

    torque.t1_ = temp_torque[0];
    torque.t2_ = temp_torque[1];
    torque.t3_ = temp_torque[2];
    torque.t4_ = temp_torque[3];
    torque.t5_ = temp_torque[4];
    torque.t6_ = temp_torque[5];

    return SUCCESS;
}

ErrorCode DynamicAlgRTM::getAccDirectDynamics(const Joint joint, const JointVelocity vel, const JointTorque torque,
                                              JointAcceleration &acc)
{
    //prepare variable.
    double M[LINKS][LINKS] = {0};
    computeMExpression(joint, M);
    double M_inverse[LINKS][LINKS] = {0};
    bool ret = getMatrixInverse(M, LINKS, M_inverse);
    if (ret == false)
    {
        return DYNAMICS_DIRECT_FAILED;
    }

    double C[LINKS][LINKS] = {0};
    computeCExpression(joint, vel, C);

    double g[LINKS] = {0};
    computeGExpression(joint, g);

    double Fv[LINKS][LINKS] = {0};
    Fv[0][0] = FV1;
    Fv[1][1] = FV2;
    Fv[2][2] = FV3;
    Fv[3][3] = FV4;
    Fv[4][4] = FV5;
    Fv[5][5] = FV6;

    double Fs[LINKS][LINKS] = {0};
    Fs[0][0] = FS1;
    Fs[1][1] = FS2;
    Fs[2][2] = FS3;
    Fs[3][3] = FS4;
    Fs[4][4] = FS5;
    Fs[5][5] = FS6;

    double sign_vel[LINKS] = {0};
    for (int i = 0; i < LINKS; ++i)
    {
        sign_vel[i] = sign(vel[i]);
    }

    double tau_he[LINKS] = {0};
    computeTauHe(joint, tau_he);

    // compute q ̈=M^(-1) (q)(τ-C(q,q ̇ ) q ̇-F_v q ̇-F_s sgn(q ̇ )-g(q)-J^T (q) h_e)
    double temp[LINKS] = {0};

    //compute with τ
    for (int i = 0; i < LINKS; ++i)
    {
        temp[i] += torque[i];
    }

    //  compute with C(q,q ̇ ) q ̇
    for (int i = 0; i < LINKS; ++i)
    {
        double C_multiply_vel = 0;
        for (int j = 0; j < LINKS; ++j)
        {
            C_multiply_vel += C[i][j] * vel[j];
        }
        temp[i] += - C_multiply_vel;
    }

    //compute with F_v q ̇
    for (int i = 0; i < LINKS; ++i)
    {
        double fv_multiply_vel = 0;
        for (int j = 0; j < LINKS; ++j)
        {
            fv_multiply_vel += Fv[i][j] * vel[j];
        }
        temp[i] += - fv_multiply_vel;
    }

    //compute with F_s sgn(q ̇ )
    for (int i = 0; i < LINKS; ++i)
    {
        double fs_multiply_sign_vel = 0;
        for (int j = 0; j < LINKS; ++j)
        {
            fs_multiply_sign_vel += Fs[i][j] * sign_vel[j];
        }
        temp[i] += - fs_multiply_sign_vel;
    }

    //compute with g(q)
    for (int i = 0; i < LINKS; ++i)
    {
        temp[i] += - g[i];
    }

    //compute with J^T (q) h_e
    for (int i = 0; i < LINKS; ++i)
    {
        temp[i] = - tau_he[i];
    }

    //compute with M^(-1) (q)
    double final_ans[LINKS] = {0};
    for (int i = 0; i < LINKS; ++i)
    {
        double M_multiply_tau = 0;
        for (int j = 0; j < LINKS; ++j)
        {
            M_multiply_tau += M_inverse[i][j] * temp[j];
        }
        final_ans[i] += M_multiply_tau;
    }

    //compute final answer.
    acc.a1_ = final_ans[0];
    acc.a2_ = final_ans[1];
    acc.a3_ = final_ans[2];
    acc.a4_ = final_ans[3];
    acc.a5_ = final_ans[4];
    acc.a6_ = final_ans[5];

    return SUCCESS;
}

